// src/components/Navbar.js
import React from 'react';
import '../assets/styles.css'; // Make sure styles are properly linked

const Navbar = () => {
  return (
    <header className="header">
      <a href="/" className="logo">
        <i className="fas fa-shopping-basket"></i> Grocery
      </a>
      <nav className="navbar">
        <a href="#home">Home</a>
        <a href="#features">Features</a>
        <a href="#products">Products</a>
        <a href="#categories">Categories</a>
        <a href="#contact">Contact</a>
      </nav>
      <div className="icons">
        <div id="menu-btn" className="fas fa-bars"></div>
        <div className="fas fa-search"></div>
        <div className="fas fa-shopping-cart"></div>
        <div className="fas fa-user"></div>
      </div>
      <form className="search-form">
        <input type="search" placeholder="Search here..." />
        <label className="fas fa-search"></label>
      </form>
    </header>
  );
};

export default Navbar;
